description:
Cast: Noelle Easton, Kiara Knight, Keegan Chillz, Chloe Foster, Chase Ryder

Runtime: 2 hrs. 22 mins.

These sexy coeds will do anything to get an A in class, even if it means seducing their teachers. Naughty Bookworms is where study sessions and student-teacher conferences turn taboo and become your hottest fantasies. Step into the classroom and let these horny students undress and teach you a lesson.



